import React from 'react'
import Manifest from './main-hero.json'
import Stadium from './main-hero.jpg'
import Boxing from '../boxing-ring.jpeg'

const CTA = () => {
    return (
        <div className='text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white'>Invest Now</div>
    )
}

const Hero = () => {
    return (
    <div className='bg-gradient-to-br from-black via-black to-gray-900'>
    <div className='flex flex-col min-h-screen justify-center items-center text-center text-white p-10 relative'>
        <img src={Stadium} alt='lights' className='mix-blend-lighten object-cover mb-10'/>
        <div className='font-extrabold text-3xl flex-1'>{Manifest.motto}</div>
        <div className='flex-1'><CTA /></div>
    </div>
    <img src={Boxing} alt='boxing' className='w-full mix-blend-lighten object-cover mb-10'/>
    </div>
    )
}

export default Hero
